selector_to_html = {"a[href=\"#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de stockage<a class=\"headerlink\" href=\"#storage-mode\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Envoi de donn\u00e9es<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#total-storage-quantity\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Quantit\u00e9 totale de stockage<a class=\"headerlink\" href=\"#total-storage-quantity\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#clear-stored-barcode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Vider le code-barres stock\u00e9<a class=\"headerlink\" href=\"#clear-stored-barcode\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523TXMEM.png\"><img alt=\"../../media/2523TXMEM.png\" src=\"../../media/2523TXMEM.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Envoi de donn\u00e9es</span><a class=\"headerlink\" href=\"#id7\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#working-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de travail<a class=\"headerlink\" href=\"#working-mode\" title=\"Lien vers cette rubrique\">#</a></h1><p>Dans la zone de travail en dehors de la port\u00e9e de la 2. R\u00e9cepteur G ou signal Bluetooth, vous pouvez activer le mode de stockage du scanner en suivant les \u00e9tapes d\u00e9crites ci-dessous. Dans ce mode, toutes les donn\u00e9es num\u00e9ris\u00e9es seront stock\u00e9es directement dans le scanner. Avant de t\u00e9l\u00e9charger les donn\u00e9es, il sera sauvegard\u00e9 en permanence dans le scanner afin que vous puissiez t\u00e9l\u00e9charger les donn\u00e9es lorsque le scanner est dans la plage de signal de r\u00e9ception.</p>", "a[href=\"#enable-automatic-storage-mode2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Activer le mode de stockage automatique<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#enable-automatic-storage-mode2\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232ANEW2A.png\"><img alt=\"../../media/25232ANEW2A.png\" src=\"../../media/25232ANEW2A.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Vider le code-barres stock\u00e9</span><a class=\"headerlink\" href=\"#id9\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232BTCNT.png\"><img alt=\"../../media/25232BTCNT.png\" src=\"../../media/25232BTCNT.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Quantit\u00e9 totale de stockage</span><a class=\"headerlink\" href=\"#id8\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Lors du t\u00e9l\u00e9versement de donn\u00e9es, le scan de la commande \u00ab\u00a0Transfert de donn\u00e9es\u00a0\u00bb annulera / arr\u00eatera le t\u00e9l\u00e9versement de donn\u00e9es.</p>\n</aside>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523INVMD.png\"><img alt=\"../../media/2523INVMD.png\" src=\"../../media/2523INVMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Mode de stockage</span><a class=\"headerlink\" href=\"#id6\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#data-upload1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Envoi de donn\u00e9es<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode Normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523NORMD.png\"><img alt=\"../../media/2523NORMD.png\" src=\"../../media/2523NORMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Mode Normal</span><a class=\"headerlink\" href=\"#id5\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#disable-automatic-storage-mode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9sactiver le mode de stockage automatique<a class=\"headerlink\" href=\"#disable-automatic-storage-mode\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#id11\"]": "<figure class=\"align-center\" id=\"id11\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23On.png\"><img alt=\"../../media/25AutoSav23On.png\" src=\"../../media/25AutoSav23On.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Activer le mode de stockage automatique</span><a class=\"headerlink\" href=\"#id11\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>En mode de transmission sans fil, lorsque le mode de stockage automatique est activ\u00e9, le code-barres sera automatiquement stock\u00e9 lorsque la transmission \u00e9choue, et les donn\u00e9es stock\u00e9es peuvent \u00eatre obtenues via \u00ab\u00a0Transfert de donn\u00e9es\u00a0\u00bb.</p>\n</aside>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23Off.png\"><img alt=\"../../media/25AutoSav23Off.png\" src=\"../../media/25AutoSav23Off.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">D\u00e9sactiver le mode de stockage automatique</span><a class=\"headerlink\" href=\"#id10\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
